import React from 'react';

const About = () => {
  return (
    <section id="about" className="py-16 bg-gray-50 text-center">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">About Us</h2>
      <p className="max-w-3xl mx-auto text-gray-600 leading-relaxed">
        Finlytiq LLP is a professional financial consulting firm helping startups and SMEs scale confidently. 
        From virtual CFO services to automated compliance and smart tax planning, we are your partners in financial clarity and control.
      </p>
    </section>
  );
};

export default About;
